import React from "react";
import projectData from "./components/projectdata";

function createProject(project) {
	return (
		<Project
			id={project.id}
			name={project.title}
			// img={contact.imgURL}
			// tel={contact.phone}
			// email={contact.email}
		/>
	);
}

const Projects = (props) => {
	return (
		<div>
			<h2>{props.title}</h2>
			{/* <img src={props.img} alt="" /> */}
			{projectData.map(createProject)}
		</div>
	);
};

export default Projects;
